jQuery(function($){
	var grid = $("#grid");
	grid.masonry({
		isAnimated: true,
		itemSelector:'.mix:not(.hidden)'
	});

	$('.filter a').click(function(e){
		var cls = $(this).attr('href').replace('#', '');
		grid.find('.hidden').fadeIn();
		grid.find('.mix').removeClass('hidden');
		grid.find('.mix:not(.'+cls+')').addClass('hidden').stop().fadeOut();
		grid.masonry('reload');
		e.preventDefault();
	})
})
